define({"topics" : [{"title":"Record Functions","shortdesc":"\n               <p class=\"shortdesc\">Use record functions to determine information about a record, such as the stage that   created it or whether a field exists\n                  in the record. \n               </p>\n            ","id":"concept_p1z_ggv_1r","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_p1z_ggv_1r","menu": {"hasChildren":false,},"tocID":"concept_p1z_ggv_1r-d46e127292","topics":[]},{"title":"Delimited Data Record Functions","shortdesc":"\n               <p class=\"shortdesc\">Use delimited data record functions to process delimited data with the list root field   type. If you configured an origin\n                  to process the delimited data with the list-map root field type,   you can use standard record functions.\n               </p>\n            ","id":"concept_s2c_q14_fs","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_s2c_q14_fs","menu": {"hasChildren":false,},"tocID":"concept_s2c_q14_fs-d46e127317","topics":[]},{"title":"Error Record Functions","shortdesc":"\n               <p class=\"shortdesc\">Error record functions provide information about error records. Use error functions to   process error records.</p>\n            ","id":"concept_ndj_43v_1r","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_ndj_43v_1r","menu": {"hasChildren":false,},"tocID":"concept_ndj_43v_1r-d46e127352","topics":[]},{"title":"Base64 Functions","shortdesc":"\n               <p class=\"shortdesc\">Use Base64 functions to encode or decode data using Base64.</p>\n            ","id":"concept_ylk_v44_jw","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_ylk_v44_jw","menu": {"hasChildren":false,},"tocID":"concept_ylk_v44_jw-d46e127397","topics":[]},{"title":"Credential Functions","id":"concept_yvc_3qs_r1b","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_yvc_3qs_r1b","menu": {"hasChildren":false,},"tocID":"concept_yvc_3qs_r1b-d46e127452","topics":[]},{"title":"Data Drift Functions","shortdesc":"\n               <p class=\"shortdesc\">Use data drift functions to create alerts when data drift occurs. You can use these         functions in data drift rules.</p>\n            ","id":"concept_hpn_xfk_p5","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_hpn_xfk_p5","menu": {"hasChildren":false,},"tocID":"concept_hpn_xfk_p5-d46e127514","topics":[]},{"title":"Field Functions","shortdesc":"\n               <p class=\"shortdesc\">You can use field functions in field path expressions that determine the set of         fields that a processor uses. Each\n                  function is evaluated against a set of matching fields         individually.\n               </p>\n            ","id":"concept_gfs_w55_3cb","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_gfs_w55_3cb","menu": {"hasChildren":false,},"tocID":"concept_gfs_w55_3cb-d46e127590","topics":[]},{"title":"File Functions","id":"concept_kxj_nyl_5x","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_kxj_nyl_5x","menu": {"hasChildren":false,},"tocID":"concept_kxj_nyl_5x-d46e127676","topics":[]},{"title":"Math Functions","id":"concept_m2m_s1f_lw","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_m2m_s1f_lw","menu": {"hasChildren":false,},"tocID":"concept_m2m_s1f_lw-d46e127769","topics":[]},{"title":"Pipeline Functions","id":"concept_dvg_nqn_wx","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_dvg_nqn_wx","menu": {"hasChildren":false,},"tocID":"concept_dvg_nqn_wx-d46e127872","topics":[]},{"title":"String Functions ","id":"concept_ahp_f4v_1r","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_ahp_f4v_1r","menu": {"hasChildren":false,},"tocID":"concept_ahp_f4v_1r-d46e127986","topics":[]},{"title":"Time Functions","shortdesc":"\n               <p class=\"shortdesc\">Use time functions to return the current time or to transform datetime data.</p>\n            ","id":"concept_qkr_trf_sw","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_qkr_trf_sw","menu": {"hasChildren":false,},"tocID":"concept_qkr_trf_sw-d46e128109","topics":[]},{"title":"Miscellaneous Functions","id":"concept_ddw_ld1_1s","href":"datacollector\/UserGuide\/Expression_Language\/Functions.html#concept_ddw_ld1_1s","menu": {"hasChildren":false,},"tocID":"concept_ddw_ld1_1s-d46e128245","topics":[]}]});